import React, { useState, useMemo } from 'react';
import './SadOMeterPage.css'; // Reuse styles for consistency
import GaugeScoreMeter from './GaugeScoreMeter';
import './GaugeScoreMeter.css';

const ANXIETY_QUESTION_POOL = [
  'How often do you feel tense or on edge, even without clear reasons?',
  'How often do you worry excessively about different things?',
  'Do you find it hard to control your worries once they start?',
  'How often do you feel restless, agitated, or unable to relax?',
  'Do you have difficulty concentrating because of your worries?',
  'How often do you feel easily fatigued or worn out by stress?',
  'Do you experience sudden feelings of panic or dread?',
  'How often do you avoid situations because they make you anxious?',
  'Do you find yourself overthinking social interactions or upcoming events?',
  'How often do you feel your heart racing, sweating, or trembling when anxious?',
  'Do you have trouble falling or staying asleep due to anxiety?',
  'How often do you feel like something bad might happen, even without reason?',
  'Do you find it hard to relax, even in calm environments?',
  'How often do you feel irritable or easily annoyed because of anxiety?',
  'Do you avoid messages, calls, or social invitations due to anxiety?',
  'How often do you feel detached from your surroundings during anxious moments?',
  'Do you worry about being judged or embarrassed in social situations?',
  'How often do you feel a sense of impending doom or danger?',
  'Do you find yourself needing reassurance from others about your worries?',
  'How often do you experience physical symptoms (headache, stomach upset) from anxiety?'
];

const ANXIETY_OPTIONS = [
  'Never',
  'Rarely',
  'Sometimes',
  'Often',
  'Almost Always'
];

function shuffle(array) {
  const arr = array.slice();
  for (let i = arr.length - 1; i > 0; i--) {
    const j = Math.floor(Math.random() * (i + 1));
    [arr[i], arr[j]] = [arr[j], arr[i]];
  }
  return arr;
}

const emojiReactions = ['ðŸ˜', 'ðŸ˜¬', 'ðŸ˜³', 'ðŸ˜°', 'ðŸ˜±'];

export default function AnxietyAnalyzerPage() {
  // Randomly select 12 questions for this session
  const questions = useMemo(() => shuffle(ANXIETY_QUESTION_POOL).slice(0, 12), []);
  const [step, setStep] = useState(0);
  const [answers, setAnswers] = useState([]);
  const [score, setScore] = useState(null);
  const [result, setResult] = useState('');
  const [loading, setLoading] = useState(false);

  // Optionally randomize options per question
  const optionsForStep = useMemo(() => shuffle(ANXIETY_OPTIONS), [step]);

  const handleAnswer = (val) => {
    setAnswers(a => {
      const newA = [...a];
      newA[step] = val;
      return newA;
    });
    setStep(s => s + 1);
  };

  const handleSubmit = async () => {
    if (answers.length < questions.length || answers.some(a => !a)) {
      setResult('Please answer all questions before submitting.');
      return;
    }
    setLoading(true);
    setResult('');
    setScore(null);
    try {
      const res = await fetch('/api/mental-health-predict', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          questions,
          answers
        })
      });
      if (!res.ok) {
        setResult('Error: Invalid or incomplete answers. Please answer all questions.');
        setLoading(false);
        return;
      }
      const data = await res.json();
      const match = data.result.match(/score is (\d{1,3})/i);
      let scoreVal = match ? parseInt(match[1]) : null;
      if (scoreVal === null || isNaN(scoreVal)) scoreVal = 60;
      setScore(scoreVal);
      setResult(data.result);
    } catch (e) {
      setResult('Error: ' + e.message);
    }
    setLoading(false);
  };

  // Animated emoji based on step
  const emoji = emojiReactions[Math.min(Math.floor((step / questions.length) * emojiReactions.length), emojiReactions.length - 1)];

  return (
    <div className="sadometer-root">
      <h2 style={{marginBottom: 0}}>Anxiety Analyzer <span style={{fontSize: 28}}>{emoji}</span></h2>
      <div className="sadometer-progress-bar">
        <div className="sadometer-progress" style={{width: `${(step / questions.length) * 100}%`}} />
      </div>
      {score === null && step < questions.length && (
        <div className="sadometer-question-card">
          <div className="sadometer-question">{questions[step]}</div>
          <div className="sadometer-options">
            {optionsForStep.map((opt, i) => (
              <button
                key={i}
                className="sadometer-option-btn"
                onClick={() => handleAnswer(opt)}
                disabled={loading}
              >
                {opt}
              </button>
            ))}
          </div>
        </div>
      )}
      {step === questions.length && score === null && (
        <div style={{marginTop: 24}}>
          <button className="feature-btn" onClick={handleSubmit} disabled={loading}>
            {loading ? 'Analyzing...' : 'See My Anxiety Score'}
          </button>
        </div>
      )}
      {score !== null && (
        <div style={{marginTop: 32}}>
          <GaugeScoreMeter
            score={score}
            label="Your Anxiety Score"
            subLabel="Anxiety Level"
            tooltip="Lower is better! This is your anxiety score."
            goodIsHigh={false}
          />
          {result && <div style={{marginTop: 18, fontWeight: 600, color: '#4caf50'}}>{result}</div>}
        </div>
      )}
      {result && !loading && score === null && (
        <div style={{marginTop: 18, fontWeight: 600, color: 'red'}}>{result}</div>
      )}
      <a href="/" className="feature-btn" style={{marginTop: 32, display: 'inline-block'}}>Back to Home</a>
    </div>
  );
}
